<script>
    active_single_header('muaban');
    $(".select_option").select2({
        width: "100%",
    });

    $('.lease_btn-xemthem').click(function() {
        $('.lease_show-xemthem').toggleClass('hidden');
        $('.lease_show-thugon').toggleClass('hidden');
        $('.lease-xemthem').toggleClass('hidden');
    })



    let discover_contry_list = document.querySelector('.user_sl_none');


    // discover_contry_list.addEventListener('mousemove',Move);
    if (discover_contry_list) {
        function Move(event) {

            let x = event.clientX;

            document.querySelector('.discover_contry_list').scroll(x, 0);
        }

        function handelMove(event) {
            let check = false;
            if (event.type == 'mousedown') {
                check = true;
            } else if (event.type == 'mouseup') {
                check = false;
            }
            if (check) {
                discover_contry_list.addEventListener('mousemove', Move);
            } else {
                discover_contry_list.removeEventListener('mousemove', Move);
            }
        }

        discover_contry_list.addEventListener('mousedown', handelMove);
        discover_contry_list.addEventListener('mouseup', handelMove);
    }

    function backgroundSize() {
        let element = document.querySelector('.estate_item.flex_column');
        let elmentBgSize = document.querySelector('.bgSize_js');

        if (element) {
            let elementChild = element.querySelector('.estate_item_ct-people');

            if (elementChild) {
                let heightParent = element.offsetHeight;
                let heightChild = elementChild.offsetHeight;

                elmentBgSize.style.backgroundSize = `100% ${heightParent - heightChild}px`;
            }
            // console.log(element.offsetWidth, element.offsetHeight);
            // console.log(element.querySelector('.estate_item_ct-people'))
        }
    }

    backgroundSize();


    function bg() {
        let full_bg_js = document.querySelector('.full_bg_js');
        let elmentBgSize = document.querySelector('.bgSize_js_1');

        if (full_bg_js && elmentBgSize) {
            let heightParent = full_bg_js.offsetHeight;
            elmentBgSize.style.backgroundSize = `100% ${heightParent}px`;
        }
    }

    bg();
</script>

